import React from "react";
import AddTransaction from "./components/AddTransaction"; // Adjusted path
import TransactionHistory from "./components/TransactionHistory"; // Adjusted path

const App = () => {
  return (
    <div>
      <h1>Expense Tracker</h1>
      <h2>Current Bala</h2>
      <AddTransaction />
      <TransactionHistory />
    </div>
  );
};

export default App;
